  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143635 includes discrete
  sample and profile data collected from Kaiyo in the Philippine Sea from 1994-02-12
  to 1994-02-16. These data include DELTA CARBON-14, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, NITRITE, Potential temperature (theta), SALINITY, WATER TEMPERATURE,
  phosphate and silicate. The instruments used to collect these data include CTD and
  bottle.nnThese data were collected by Kei Muneyama of Japan Agency for Marine-Earth
  Science and Technology (JAMSTEC) as part of the GLODAPv2_49XK19940212 data set.
